// Functions
function enforceBounds(x) {
  if (x < 0) {
    return 0;
  } else if (x > 1){
    return 1;
  } else {
    return x;
  };
};

function interpolateLinearly(x, values) {

  // Split values into four lists
  var x_values = [];
  var r_values = [];
  var g_values = [];
  var b_values = [];
  for (i in values) {
    x_values.push(values[i][0]);
    r_values.push(values[i][1][0]);
    g_values.push(values[i][1][1]);
    b_values.push(values[i][1][2]);
  }

  var i = 1;
  while (x_values[i] < x) {
    i = i + 1;
  }
  i = i - 1;

  var width = Math.abs(x_values[i] - x_values[i + 1]);
  var scaling_factor = (x - x_values[i]) / width;

  // Get the new color values though interpolation
  var r = r_values[i] + scaling_factor * (r_values[i + 1] - r_values[i])
  var g = g_values[i] + scaling_factor * (g_values[i + 1] - g_values[i])
  var b = b_values[i] + scaling_factor * (b_values[i + 1] - b_values[i])

  return [enforceBounds(r), enforceBounds(g), enforceBounds(b)];

};

function drawColormap(max_value, color_key) {

  var points = {};

  for (i = 0; i <= max_value * 2; i += 0.1) {
    var color = interpolateLinearly(i / (max_value * 2), window[color_key]);

    r = Math.round(255 * color[0]);
    g = Math.round(255 * color[1]);
    b = Math.round(255 * color[2]);

    display_value = 'rgb(' + r + ', ' + g + ', ' + b + ')';
    points[(i - max_value).toFixed(1)] = display_value;
  };

  var color = interpolateLinearly(1, window[color_key]);

  r = Math.round(255 * color[0]);
  g = Math.round(255 * color[1]);
  b = Math.round(255 * color[2]);
  display_value = 'rgb(' + r + ', ' + g + ', ' + b + ')';
  points[max_value.toFixed(1)] = display_value;

  return points;
};
